import React from "react";
import Item from "./Items";

export default function List({ blocktext, moveToNext }) {
  return (
    <div>
      {blocktext.map((v, index) => (
        <div>
          <Item
            text={v.text}
            moveToNext={moveToNext}
            index={index}
            key={v.text[index]}
          />
        </div>
      ))}
      <button class="end">+ Add a card</button>
    </div>
  );
}
